function SearchStuffAndTap(stuffName)
    local stuff = stuffs[stuffName]
    if stuff ~= nil then
        for i = 1, 2, 1 do
            for i = 1, #stuff, 1 do
                local x,y = findMultiColorInRegionFuzzy(table.unpack(stuff[i]));
                if x ~= -1 then
                    dialog("x:"..x..",y:"..y)
                    mSleep(600)    
                end
                
            end
        end
    end

end


